import React, { Component } from 'react';
import { Button } from 'antd';
import { RightOutlined } from '@ant-design/icons';
import './SubmitCheckoutSessionDialog.style.scss';

export default class SubmitCheckoutSessionDialog extends Component {
  render() {
    const { checkedOutProducts } = this.props;

    return (
      <div className="money-counting__submit-checkout-session-dialog">
        <div className="money-counting__submit-checkout-session-dialog__btn-open-wrapper">
          <Button
            className="money-counting__submit-checkout-session-dialog__btn-open-wrapper__btn"
            type="primary"
            // disabled={checkedOutProducts.length === 0}
          >
            <span style={{ marginRight: 5 }}>Xuất hóa đơn</span>
            <RightOutlined />
          </Button>
        </div>
      </div>
    )
  }
}
